import React, {useState} from 'react';
import one from './Item/black-damka.svg'
import ObjectItem from "./Item/ObjectItem";

const Objects = () => {
    const object = {id: 1, name: 'Object1', description:"торт"};
    const object2 = {id: 1, name: 'Object1', description:"торт"};
    const object3 = {id: 1, name: 'Object1', description:"торт"};

    return (
        <div>
            <h1>
                Object page
            </h1>
            <ObjectItem name={object.name} image={one} des={object.description}/>
        </div>
    );
};

export default Objects;
